import Input from "./Input";
import "./Form.css";

export default function Form() {
  const [user, setUser] = useState({ email: "", password: "" });
  return (
    <div className="Form">
      <h1>Please register</h1>
      <form>
        <Input label="Email" name="email" type="email" required={true} />{" "}
        <Input
          label="Password"
          name="password"
          type="password"
          required={true}
        />
        <button>Submit</button>
      </form>
    </div>
  );
}
